// SignOut.js
import React from 'react';

const LogIn = () => {
  return (
    <div>
      <h2>Log In Page</h2>
      <p>Log in to access your account.</p>
      <p>Username Area</p>
      <p>Password Area</p>

      <a href="/components/about"><button type="submit">Login</button></a>

      <button type="submit">Don't have an account? Signup!</button>
    </div>
  );
};

export default LogIn;
